function genRandomPassword() {
	var salt = "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789";
	var len = salt.length;
	var makepass = '';
	for (var i = 0; i < 32; i++) {
		var randomnumber = Math.floor(Math.random()*len);
		makepass += salt[randomnumber];
	}
	return makepass;
}

